const { FileSDK, compatibleSDK } = require('./sdk');

function createFileSDK(serviceId, axiosInstance) {
    const file = new FileSDK(serviceId, axiosInstance);
    return file;
}

function createCompatibleFileSDK(serviceId, axiosInstance) {
    const file = new FileSDK(serviceId, axiosInstance);
    return compatibleSDK(file);
}

module.exports = {
    createFileSDK,
    createCompatibleFileSDK,
};
